import styled from "styled-components";

export const HeaderStyled = styled.header`
  width: 100%;
  height: 50px;
  background-color: var(--darkBlue);
  color: var(--mainGray);
  position: fixed;
  top: 0;
  left: 0;

  .image-container {
    width: 20px;
    height: 20px;
  }
  .image-container img {
    width: 100%;
    height: 100%;
  }
`;
